      SELECT DISTINCT + + ( + + col1 ) * + col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 4 BETWEEN + col0 AND - col1 * - - col1 - - CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q1807.out
    data: |
      2601
      4489
      5929
